import React from 'react'
import Slika from "../slike/Logo.png"
import Slika2 from "../slike/User.png"


function Header() {
  return (
    <div className='header'>
      <img src={Slika}></img>
      <img src={Slika2}></img>
    </div>
  )
}

export default Header
